sys_variable_value.value:
(function execute(inputs, outputs) {
	var ci = new GlideRecord("cmdb_ci");
	ci.addQuery("name", inputs.ci);
	ci.query();
	while (ci.next()) {
		var CISysId = ci.getValue("sys_id");
	}
	var cis = new GlideRecord("cmdb_ci_server");
	cis.addQuery("sys_id", CISysId);
	cis.query();
	check = {
		"checkDefId": "ed5189c6db7c20102266187d13961928",
		"params": {
			"query": inputs.query
		}
	};
	var agentNow = new sn_agent.AgentNowHandler();
	var reqId = agentNow.runCheckForCis(cis, check, '1', inputs.timeout);
	outputs.request_id = reqId;
})(inputs, outputs);

